import styled from 'styled-components';

const Container = styled.div`
  display: flex;
  width: 100%;
  max-height: 700px;
  border-bottom: 2px solid #e6ecf0;
  padding: 10px;
  &:hover {
    background-color: #f4f8fa;
  }
`;


const Comment = ({ comment }) => {
  return (
    <Container>

    </Container>
  );
};

export default Comment;
